	('c88f10bb-dd18-46fb-9e63-c35f663b2db1', 'heading_1', 'Adding agent seats to your subscription', '{}', '35434fb7-9add-452c-bcbd-0a313abbf474', NULL, '2024-04-05 20:06:56.275+00'),
	('80974947-b281-4b04-b896-54602d257c58', 'paragraph', 'You can purchase seats from the subscription page.', '{}', '35434fb7-9add-452c-bcbd-0a313abbf474', 'c88f10bb-dd18-46fb-9e63-c35f663b2db1', '2024-04-05 20:07:16.964+00'),
	('af94ce7b-7025-4bf5-b424-6b269735cb08', 'heading_2', 'Hey there!', '{}', 'bb491ec0-8345-40c2-8ac9-fce882ba5c7e', '70e89b06-c3a8-440d-8ea7-49919b674f97', '2024-04-05 19:09:25.52831+00'),
	('70e89b06-c3a8-440d-8ea7-49919b674f97', 'heading_3', 'Testing one two three four five', '{}', 'bb491ec0-8345-40c2-8ac9-fce882ba5c7e', 'd965d7da-c6bf-4ecb-90cf-95f4749b4e94', '2024-04-05 19:09:25.52831+00'),
	('496fe42c-eb5c-41e1-9585-dcb5be40f11c', 'paragraph', 'You can purchase agent seats from the Subscription page in Admin Center. For some accounts, you can also purchase more seats when you add agent user profiles. If neither of these options are available, you can use a simple request form to contact your sales representative directly and purchase additional agent seats.', '{}', 'dbfc387a-a7b9-49f0-8bbf-38d759a904d8', '290445a3-f80b-47e9-9e8f-dcd760f5ac4c', '2024-04-05 19:16:48.982+00'),
	('26c3f010-7f62-4817-945c-d6cf6e72d985', 'paragraph', 'If you''ve filled all available agent seats in your Zendesk account, you can add more agents by purchasing additional agent seats. To help you proactively manage your account, Zendesk will notify you when you''ve used up all available agent seats and direct you on how to purchase more.', '{}', 'dbfc387a-a7b9-49f0-8bbf-38d759a904d8', '496fe42c-eb5c-41e1-9585-dcb5be40f11c', '2024-04-05 19:51:56.766+00'),
	('0c986842-cf9b-4120-9a39-4cd725bd8a15', 'heading_3', 'Purchasing agent seats from the Subscription page', '{}', 'dbfc387a-a7b9-49f0-8bbf-38d759a904d8', '26c3f010-7f62-4817-945c-d6cf6e72d985', '2024-04-05 19:52:07.927+00'),
	('60c58d82-c3fb-4e0e-839b-3da2db72ee61', 'paragraph', 'To help you manage agent subscriptions and payments for your Kirridesk products, use the Subscriptions page in Admin Center to view all available plan subscriptions (including temporary agent subscriptions).', '{}', 'dbfc387a-a7b9-49f0-8bbf-38d759a904d8', '0c986842-cf9b-4120-9a39-4cd725bd8a15', '2024-04-05 19:52:41.467+00'),
	('e3cfbf66-a7b8-422c-9875-0e0bcc22cd9e', 'paragraph', 'The procedure for adding agent seats varies depending on whether you have a self-service account, a sales-assisted account, or a Kirridesk -managed account. See About Kiridesk account types for billing and subscription management.', '{}', 'dbfc387a-a7b9-49f0-8bbf-38d759a904d8', '60c58d82-c3fb-4e0e-839b-3da2db72ee61', '2024-04-05 19:52:54.404+00'),
	('290445a3-f80b-47e9-9e8f-dcd760f5ac4c', 'heading_1', 'Things to check before restarting', '{}', 'dbfc387a-a7b9-49f0-8bbf-38d759a904d8', NULL, '2024-04-05 19:13:46.249+00');
